import React from 'react';
import { IonSlides, IonSlide, IonContent } from '@ionic/react'

interface ProductSliderProps extends RouteComponentProps<{
  imagesListID: string;
}> {}

const ProductSlider: React.FC = () => (
  <IonContent>
    {/* <IonSlides pager={true}> */}
    <IonSlides pager={true}>
      <IonSlide>
        <h1>Slide 1</h1>
      </IonSlide>
      <IonSlide>
        <h1>Slide 2</h1>
      </IonSlide>
      <IonSlide>
        <h1>Slide 3</h1>
      </IonSlide>
    </IonSlides>
  </IonContent>
)

export default ProductSlider
